  \"2013-03-19T00:36:31.448848\",\n\t\"name\": \"ash-fall-contour-map-of-the-2009-eruption-of-redoubt-volcano-alaska-digital-shapefiles-of-conto\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 2009 eruption of Redoubt Volcano included
  19 major tephra-producing explosions. Mass per unit area (MPUA) ash fall sampling
  of the resulting deposits allowed us to create isomass contours of the ash fall.
  This dataset contains the vector digital shapefiles of the ash fall contours for
  the explosive events. In addition, a point digital shapefile is included that describes
  more than 400 ash fall samples that were collected. For a detailed account of the
  2009 eruption of Redoubt Volcano, see Schaefer, J.R., ed., 2012, The 2009 eruption
  of Redoubt Volcano, Alaska, with contributions by Bull, Katharine, Cameron, Cheryl,
  Coombs, Michelle, Diefenbach, Angie, Lopez, Taryn, McNutt, Steve, Neal, Christina,
  Payne, Allison, Power, John, Schneider, Dave, Scott, William, Snedigar, Seth, Thompson,
  Glenn, Wallace, Kristi, Waythomas, Chris, Webley, Peter, and Werner, Cynthia: Alaska
  Division of Geological & Geophysical Surveys Report of Investigation 2011-5, 45
  p., available at http://www.dggs.alaska.gov/pubs/id/23123 . For a detailed description
  of the tephra fall deposits, see Wallace, K.L., Schaefer, J.R., and Coombs, M.L.,
  in press, Character, mass, distribution, and origin of tephra-fall deposits from
  the 2009 eruption of Redoubt Volcano, Alaskau00e2u0080u0094highlighting the importance
  of particle aggregation: Journal of Volcanology and Geothermal Research.\",\n\t\"license_title\":
